import './style.css';

function Card( props ) {
    
    return(<div className='card' title={ props.title } content={ props.content }>
        <div>
            <div class='bagde-verde'></div>
            <div className='bol-amarela'></div>
        </div>
        <h1> { props.title } </h1>
        <p> { props.content } </p>
    </div>)
}

export default Card;
